import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';
import { Link } from 'react-router-dom';

const NavBlock = styled.div`
position: fixed;
height: 100%;  
width: 12rem;
background: green;
box-shadow: 0px 4px 2px rgba(0, 0, 0, 0.08);


`;
const Wrapper = styled.ul`
margin:0;
background:green;
font-weight: 800;
list-style:none;
width:100%;
padding: 10;
 
`;

const Menu = styled.li`

font-size: 1.5rem;
display: normal;
width:100%;
&:hover{
  background:white;
}
`
const Spacer = styled.nav`


`;

const Nav = () => {
    return (
        <>
        <NavBlock>
            <Wrapper>
              <Menu>게시판</Menu>
              <Menu>모임</Menu>
              <Menu>미션&amp;식물</Menu>
              <Menu>메뉴</Menu>
              
           </Wrapper>
        </NavBlock>
        <Spacer/>
        
        </>
    );
};

export default Nav;
